import Vue from 'vue';
import ElementUI from 'element-ui';
import 'element-ui/lib/theme-chalk/index.css';
import App from './App.vue';
import myTemp from "@/components/MyTemp";

Vue.use(ElementUI);
Vue.use(myTemp)

new Vue({
  el: '#app',
  render: h => h(App)
});
